import React, {useState} from "react";
import Input from "../components/Input";

export default function Register(){

  const [name, setName] = useState('');

  return (
    <div className='main'>
      <div className='header2'>

      </div>
      
      <div className='register'>
        <Input
          distinct={"Short"}
          type={"text"}
          placeholder={"아이디"}
          value={name}
          setValue={setName}
        /><br/>
        <Input
          type={"text"}
          placeholder={"비밀번호"}
          value={name}
          setValue={setName}
        /><br/>
        <Input
          type={"text"}
          placeholder={"이름"}
          value={name}
          setValue={setName}
        />
        <Input
          distinct={"Short"}
          type={"text"}
          placeholder={"휴대폰"}
          value={name}
          setValue={setName}
        />
        <Input
          distinct={"Short"}
          type={"text"}
          placeholder={"닉네임"}
          value={name}
          setValue={setName}
        />
      </div>
    </div>
  )
}

//export default Register;
